import React, { useEffect, useState } from "react";
import axiosInstance from "../api/axiosInstance";

const DealTable = () => {
  const [deals, setDeals] = useState([]);

  useEffect(() => {
    axiosInstance.get("/deals").then((res) => setDeals(res.data));
  }, []);

  return (
    <div className="card">
      <h2>Deals</h2>
      <table>
        <thead>
          <tr><th>Title</th><th>Amount</th><th>Stage</th></tr>
        </thead>
        <tbody>
          {deals.map((d) => (
            <tr key={d._id}>
              <td>{d.title}</td><td>{d.amount}</td><td>{d.stage}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DealTable;
